    public int[] getNext(String ps) {//KMP标准实现。next[j]的值（也就是k）表示，当P[j] != T[i]时，j指针的下一步移动位置
        char[] p = ps.toCharArray();
        int[] next = new int[p.length];
        next[0] = -1;
        int j = 0;
        int k = -1;
        while (j < p.length - 1) {
            if (k == -1 || p[j] == p[k]) {
                next[++j] = ++k;
            } else {
                k = next[k];
            }
        }
        return next;
    }
    public int strStr(String haystack, String needle) {
        int lenHaystack=haystack.length(),lenNeedle=needle.length();
        if(lenNeedle==0)//needle为空字符串
            return 0;
        if(lenHaystack==0||lenHaystack<lenNeedle)//haystack为空字符串（不包含needle为空字符串的情况），或者haystack比needle短
            return -1;
        int i=0,j=0;
        int[] pmt=getNext(needle);
        System.out.println(Arrays.toString(pmt));
        while(j<lenNeedle&&i<lenHaystack){
            System.out.println(i+"\t"+j);
            if(haystack.charAt(i)==needle.charAt(j)) {
                i++;
                j++;//i表示文本串与模式串匹配的首位置。一次匹配过程中保持不变。模式串中，下标：0<=j<needle.length()
            }
            else{
                if(pmt[j]==-1)//文本串取下一个字符，模式串回到字符串首部
                {
                    j=0;
                    i++;
                }else
                    j=pmt[j];
            }
        }
        if(j==lenNeedle)
            return i-j;
        else
            return -1;
    }

